SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE DATABASE IF NOT EXISTS survey;


 CREATE TABLE IF NOT EXISTS survey_designer(
	sd_id int NOT NULL,
	sd_name varchar(50) DEFAULT NULL,
	sd_surname varchar(50) DEFAULT NULL,
	sd_age int DEFAULT NULL,
	sd_sex varchar(7) DEFAULT NULL,
	sd_department varchar(50) DEFAULT NULL);
    	
	
	CREATE TABLE IF NOT EXISTS survey(
	sd_id int NOT NULL,
	survey_id int NOT NULL,
	title longtext DEFAULT NULL,
	survey_year date DEFAULT NULL,
    survey_status boolean DEFAULT FALSE);


	
	CREATE TABLE IF NOT EXISTS survey_taker(
	st_id int NOT NULL,
	student_id int NOT NULL,
	st_name nchar(50) DEFAULT NULL,
	st_surname nchar(50) DEFAULT NULL,
	st_age int DEFAULT NULL,
	st_sex char(7) DEFAULT NULL,
	st_department nchar(50) DEFAULT NULL);


	CREATE TABLE IF NOT EXISTS questions(
	survey_id int NOT NULL,
	question_id int NOT NULL,
	question_text longtext DEFAULT NULL,
	choice_num int NOT NULL);


	CREATE TABLE IF NOT EXISTS choice(
	choice_num int NOT NULL,
	choice_text longtext DEFAULT NULL,
	question_id int NOT NULL,
	survey_id int NOT NULL);

	CREATE TABLE IF NOT EXISTS answers(
	choice_num int NOT NULL,
	question_id int NOT NULL,
	st_id int NOT NULL,
	survey_id int NOT NULL);
    
    
    ALTER TABLE `survey_taker`
  ADD PRIMARY KEY (`st_id`);
  
  ALTER TABLE `survey_designer`
  ADD PRIMARY KEY (`sd_id`);

ALTER TABLE `survey`
  ADD PRIMARY KEY (`survey_id`),
  ADD FOREIGN KEY (`sd_id`) REFERENCES survey_designer(`sd_id`);
  
  ALTER TABLE `questions`
  ADD PRIMARY KEY (`question_id`),
  ADD FOREIGN KEY (`survey_id`) REFERENCES survey(`survey_id`);

  ALTER TABLE `choice`
  ADD PRIMARY KEY (`choice_num`),
  ADD FOREIGN KEY (`question_id`) REFERENCES question(`question_id`),
  ADD FOREIGN KEY (`survey_id`) REFERENCES survey(`survey_id`);
   
   ALTER TABLE `answers`
   ADD FOREIGN KEY (`choice_num`) REFERENCES choice(`choice_num`),
   ADD FOREIGN KEY (`st_id`) REFERENCES survey_taker(`st_id`),
   ADD FOREIGN KEY (`question_id`) REFERENCES question(`question_id`),
   ADD FOREIGN KEY (`survey_id`) REFERENCES survey(`survey_id`);
    


















	
